import React from 'react';

const fotoTeste = 'encurtador.com.br/szCP6'
const fotoTeste2 = 'encurtador.com.br/gAO79'

const arrayImage = [fotoTeste, fotoTeste2];

const criaImagem = (linkImg) => {
    const image = document.createElement('img');
    image.className = 'imagem-teste';
    image.src = linkImg
};



class Blocks extends React.Component {
    render() {
        return (

            <div className='block-image'>
                {arrayImage.map((imagens) => {
                    return criaImagem(imagens)
                })}
            </div>
        )
    }
}

export default Blocks;
